(37, '2024-10-27', 'what is your name?', 'My name is DOA, your Dean\'s Office Assistant. How can I assist you today?', 0, NULL, 0, 1, 0.0000000001, 0.0000000001),
(38, '2024-09-20', 'who should i contact for questions?', 'You can reach out to ccsstax@gmail.com for any questions you may have.', 5, NULL, 0, 0, 0.000223914, 0.01),
(39, '2024-09-20', 'what if i cant attend the meeting?', 'If you can\'t make it, reach out to Dean Aim D Sky as soon as possible. The meeting might have key details you\'ll need.', 5, NULL, 0, 0, 0.000223914, 0.01),
(40, '2024-09-20', 'when is the meeting?', 'The meeting will be today September 20,2024 at 3:00 PM. Don\'t forget to check for details on the announcement area or the official CCS Facebook page.', 5, NULL, 0, 0, 0.000223914, 0.01),
(41, '2024-09-20', 'what should i do if i have questions?', 'If you have questions, please contact ccsstax@gmail.com.', 5, NULL, 0, 0, 0.000223914, 0.01),
(42, '2024-09-20', 'what is the update about?', 'The update is about the First Semester AY 2024-2025. Room assignments are now available. Kung may tanong ka, feel free to reach out to ccsstax@gmail.com.', 5, NULL, 0, 0, 0.000223914, 0.01),
(43, '2024-09-20', 'where can i find the room assignments?', 'You can find the room assignments in the latest First Semester update. You can also contact the CCS office if you\'re unsure.', 5, NULL, 0, 0, 0.000223914, 0.01),
(44, '2024-09-20', 'who should i contact for more questions about my class schedule?', 'If your question is about your schedule, you can reach out to ccsstax@gmail.com. Don\'t hesitate to ask!', 5, NULL, 0, 0, 0.000223914, 0.01),
(45, '2024-09-20', 'may deadline ba sa pagtanong about room assignments?', 'Wala namang binanggit na deadline sa post, but its better to ask as soon as possible. You can send an email or check with the CCS office.', 5, NULL, 0, 0, 0.000223914, 0.01),
(46, '2024-09-20', 'what should i do if i have questions?', 'For any questions about this update, simply send an email to ccsstax@gmail.com. They\'ll help you out!', 5, NULL, 0, 0, 0.000223914, 0.01),
(47, '2024-09-20', 'who is leading the meeting?', 'Dean Aim D Sky will be leading this meeting.', 5, NULL, 0, 0, 0.000223914, 0.01),
(48, '2024-09-20', 'what is the update about?', 'The updated First Semester AY 20242025 is now available with room assignments.', 5, NULL, 0, 0, 0.000223914, 0.01),
(49, '2024-09-20', 'is there a deadline to ask questions?', 'The post does not specify a deadline for questions.', 5, NULL, 0, 0, 0.000223914, 0.01),
(50, '2024-09-20', 'what is the capstone project orientation for?', 'The Capstone Project Orientation is to guide students about the upcoming Capstone project. If you have questions, feel free to ask during the session or send an email.', 5, NULL, 0, 0, 0.000223914, 0.01),
(51, '2024-09-20', 'kailan ba ang orientation?', 'The post doesn\'t mention a specific date, so stay tuned for more details. You can always check the announcement board or official CCS Facebook page for updates.', 5, NULL, 0, 0, 0.000223914, 0.01),
(52, '2024-09-20', 'will there be a recording of the orientation?', 'The post doesnt mention if the orientation will be recorded. Best to check with the organizers directly if you miss the live session.', 5, NULL, 0, 0, 0.000223914, 0.01),
(53, '2024-09-20', 'who should proceed to the dean\'s office?', 'Students Princess Feb Montealto and Redd Urbina need to proceed to the Deans Office.', 5, NULL, 0, 0, 0.000223914, 0.01),
(54, '2024-09-20', 'is there a specific time to go to the dean\'s office?', 'Theres no specific time mentioned in the post, so its best to head there as soon as possible or check for further details.', 5, NULL, 0, 0, 0.000223914, 0.01),
(55, '2024-09-20', 'what if i need more information about this?', 'If you need more info, you can ask directly at the Deans Office.', 5, NULL, 0, 0, 0.000223914, 0.01),
(56, '2024-09-20', 'where can i find the room assignments?', 'The room assignments are included in the updated First Semester AY 2024-2025 announcement.', 5, NULL, 0, 0, 0.000223914, 0.01),
(57, '2024-09-20', 'how can i join the orientation?', 'Just use Zoom Meeting ID 952 8497 1821 and Passcode 230507 to join the orientation. See you there!', 5, NULL, 0, 0, 0.000223914, 0.01),
(58, '2024-09-20', 'how can i join the meeting?', 'You can join the meeting via Zoom using Meeting ID 989 9807 0130 and Passcode 806127. Make sure to have the details ready.', 5, NULL, 0, 0, 0.000223914, 0.01),
(59, '2024-09-14', 'who is the new instructor?', 'The new instructor is Ms. Princess Joy Tuazon. She will be teaching BSIT and BSCS students.', 5, NULL, 0, 0, 0.000223914, 0.01),
(60, '2024-09-14', 'what should the section presidents do?', 'Section presidents are requested to add Ms. Tuazon to their group chats.', 5, NULL, 0, 0, 0.000223914, 0.01),
(61, '2024-09-14', 'may bagong instructor ba sa bsit at bscs?', 'Oo, si Ms. Princess Joy Tuazon ang bagong instructor niyo. She\'ll start teaching soon.', 5, NULL, 0, 0, 0.000223914, 0.01),
(62, '2024-09-14', 'when will the classes with ms. tuazon start?', 'Ms. Tuazon\'s classes will start on Monday. Be sure to be prepared!', 5, NULL, 0, 0, 0.000223914, 0.01),
(63, '2024-09-14', 'what if i have more questions about the new instructor?', 'If you have more questions about Ms. Tuazon or the class, you can reach out to your section president for more details.', 5, NULL, 0, 0, 0.000223914, 0.01),
(64, '2024-09-13', 'how can i get more details about the bls training?', 'If you are one of the mentioned students, please contact the sender of the post regarding the BLS training.', 5, NULL, 0, 0, 0.000223914, 0.01),
(65, '2024-09-13', 'what is this link about?', 'Kindly check the Facebook link for more information about the post. You can find the latest update through the provided link.', 5, NULL, 0, 0, 0.000223914, 0.01),
(66, '2024-09-13', 'ano ang dapat gawin ng mga nabanggit na estudyante?', 'Ang mga estudyanteng sina John Lawrence, Cristine Faye, at Andy Gabriel ay kailangang makipag-ugnayan tungkol sa BLS training.', 5, NULL, 0, 0, 0.000223914, 0.01),
(67, '2024-09-13', 'where can i find more details about this post?', 'You can click the link to find more details on the official CCS Facebook page.', 5, NULL, 0, 0, 0.000223914, 0.01),
(68, '2024-09-13', 'what is the announcement about?', 'The announcement is calling the attention of specific students regarding the BLS training.', 5, NULL, 0, 0, 0.000223914, 0.01),
(69, '2024-09-13', 'who needs to contact regarding bls training?', 'John Lawrence A. De Leon (BSIT 1B), De Guzman Cristine Faye O. (BSCS 1B), and Sarne Andy Gabriel R. (BSIT 1D) are requested to contact regarding the BLS training ASAP.', 5, NULL, 0, 0, 0.000223914, 0.01),
(70, '2024-09-13', 'is the link official?', 'Yes, this is a link from the official CCS Facebook page. Be sure to check the page for any updates.', 5, NULL, 0, 0, 0.000223914, 0.01),
(71, '2024-09-13', 'saan naka-link ang post na ito?', 'Pindutin ang link na ito upang makita ang impormasyon mula sa Facebook page ng CCS.', 5, NULL, 0, 0, 0.000223914, 0.01),
(72, '2024-09-06', 'who is the new instructor for gec 107?', 'The new instructor for GEC 107 is Ms. Kim Airah Alay.', 5, NULL, 0, 0, 0.000223914, 0.01),
(73, '2024-09-06', 'what should section presidents do?', 'Section presidents should add Ms. Alay to their group chats.', 5, NULL, 0, 0, 0.000223914, 0.01),
(74, '2024-09-06', 'when will ms. alay start teaching?', 'The post does not mention a specific start date, so please stay updated through your section president or check the official CCS Facebook page.', 5, NULL, 0, 0, 0.000223914, 0.01),
(75, '2024-09-06', 'sino ang bagong instructor para sa gec 107?', 'Si Ms. Kim Airah Alay ang bagong instructor niyo para sa GEC 107. Make sure to welcome her!', 5, NULL, 0, 0, 0.000223914, 0.01),
(76, '2024-09-06', 'can i contact the new instructor directly?', 'Its best to communicate through your section president, who will add Ms. Alay to the group chats.', 5, NULL, 0, 0, 0.000223914, 0.01),
(77, '2024-09-05', 'paano ko makukumpleto ang feedback form?', 'Pindutin ang Google Forms link sa post at kumpletuhin ang form para ibahagi ang iyong karanasan sa orientation.', 5, NULL, 0, 0, 0.000223914, 0.01),
(78, '2024-09-05', 'where can i find the feedback form?', 'You can find the feedback form through the Google Forms link provided in the post.', 5, NULL, 0, 0, 0.000223914, 0.01),
(79, '2024-09-05', 'why do i need to complete the form?', 'The form helps the school gather feedback to improve future orientations. Your input is highly valuable.', 5, NULL, 0, 0, 0.000223914, 0.01),
(80, '2024-09-05', 'what is the feedback form for?', 'The feedback form is for collecting your thoughts and experiences from the First-Year Orientation held on August 29, 2024. Please fill it out to help improve future events!', 5, NULL, 0, 0, 0.000223914, 0.01),
(81, '2024-09-05', 'is the feedback form mandatory?', 'While it\'s not mandatory, your feedback is highly appreciated and will help improve future orientations for incoming students.', 5, NULL, 0, 0, 0.000223914, 0.01),
(82, '2024-09-05', 'sino ang papalit kay ms. roca bilang instructor ng gec 107?', 'Wala pang ibinigay na detalye tungkol sa kapalit ni Ms. Roca, kaya\'t maghintay para sa karagdagang anunsyo.', 5, NULL, 0, 0, 0.000223914, 0.01),
(83, '2024-09-05', 'which subjects still don\'t have an instructor assigned?', 'The subjects without an instructor assigned are ITEC 101, ITEP 203, ITST 302, ITEP 308, and GEC SOSLIT.', 5, NULL, 0, 0, 0.000223914, 0.01),
(84, '2024-09-05', 'when will the classes for itep 101 start?', 'The class for ITEP 101 is still in process, but you can assume that it will begin next week.', 5, NULL, 0, 0, 0.000223914, 0.01),
(85, '2024-09-04', 'when will the medical certificates for nstp 1 be released?', 'The medical certificates for NSTP 1 will be released soon by the office. Please wait for further announcements regarding the date and time.', 5, NULL, 0, 0, 0.000223914, 0.01),
(86, '2024-09-04', 'when will the transition to online classes happen?', 'The transition to online classes will begin at 12:00 PM.', 5, NULL, 0, 0, 0.000223914, 0.01),
(87, '2024-09-04', 'how will we know when the medical certificates are ready?', 'The office will make an announcement regarding the exact date and time of the release of NSTP 1 medical certificates.', 5, NULL, 0, 0, 0.000223914, 0.01),
(88, '2024-09-04', 'how can we coordinate the online classes?', 'Please coordinate with your instructors regarding the details of the online classes.', 5, NULL, 0, 0, 0.000223914, 0.01),
(89, '2024-09-04', 'ano ang gagawin paglipat sa online classes?', 'Mag-coordinate sa inyong mga instructors para malaman ang mga detalye ng online classes.', 5, NULL, 0, 0, 0.000223914, 0.01),
(90, '2024-09-04', 'kailan mailalabas ang mga medical certificates ng nstp 1?', 'Maghihintay muna ng karagdagang anunsyo mula sa opisina tungkol sa eksaktong petsa at oras ng paglabas.', 5, NULL, 0, 0, 0.000223914, 0.01),
(91, '2024-08-30', 'sino ang bagong instructor ng gec subjects?', 'Ang bagong instructor para sa GEC 101, GEC 102, at GEC 103 ay si Mr. John Raven Ramos.', 5, NULL, 0, 0, 0.000223914, 0.01),
(92, '2024-08-30', 'which subjects don\'t have an instructor assigned yet?', 'The subjects without instructors are ITEP 101, ITEC 101, ITEP 203, ITST 302, ITEP 308, and GEC SOSLIT.', 5, NULL, 0, 0, 0.000223914, 0.01),
(93, '2024-08-30', 'when will the instructor for gec soslit be assigned?', 'No specific date is mentioned for when the GEC SOSLIT instructor will be assigned. Please wait for further updates.', 5, NULL, 0, 0, 0.000223914, 0.01),
(94, '2024-08-30', 'aling mga subjects ang wala pang instructor?', 'Ang mga subjects na walang instructor ay ITEP 101, ITEC 101, ITEP 203, ITST 302, ITEP 308, at GEC SOSLIT.', 5, NULL, 0, 0, 0.000223914, 0.01),
(95, '2024-08-30', 'who is the new instructor for gec subjects?', 'The new instructor for GEC 101, GEC 102, and GEC 103 is Mr. John Raven Ramos.', 5, NULL, 0, 0, 0.000223914, 0.01),
(96, '2024-08-30', 'what subjects will mr. john raven ramos teach?', 'Mr. John Raven Ramos will teach GEC 101, GEC 102, and GEC 103.', 5, NULL, 0, 0, 0.000223914, 0.01),
(97, '2024-08-29', 'saan gaganapin ang itst 301 laboratory class para sa bsinfo wam 3a?', 'Ang ITST 301 Laboratory Class para sa BSInfo WAM 3A ay gaganapin sa CCL4, 2nd floor ng Academic Building, kahanay ng College Building.', 5, NULL, 0, 0, 0.000223914, 0.01),
(98, '2024-08-29', 'what is the schedule for the itst 301 laboratory class?', 'The announcement mentions the location of the class but does not specify the schedule.', 5, NULL, 0, 0, 0.000223914, 0.01),
(99, '2024-08-29', 'where will the itst 301 laboratory class for bsinfo wam 3a be held?', 'The ITST 301 laboratory class for BSInfo WAM 3A will be held at CCL4 on the 2nd floor of the Academic Building, next to the College Building.', 5, NULL, 0, 0, 0.000223914, 0.01),
(100, '2024-08-28', 'saan ko makikita ang schedule ng unang semester?', 'Makikita mo na ang schedule ng First Semester AY 2024-2025 kasama ang room assignments.', 5, NULL, 0, 0, 0.000223914, 0.01),
(101, '2024-08-28', 'how can i contact the ccs office if i have questions about my schedule?', 'You can reach out to the CCS office by sending an email to ccsstax@gmail.com.', 5, NULL, 0, 0, 0.000223914, 0.01),
(102, '2024-08-28', 'where can i find the schedule for the first semester ay 2024-2025?', 'Your schedule for the First Semester AY 2024-2025 is already out, including room assignments. Check your portal or official announcements.', 5, NULL, 0, 0, 0.000223914, 0.01),
(103, '2024-08-27', 'when is the wam 3b online meeting scheduled?', 'The WAM 3B online meeting is scheduled for tomorrow, September 21, 2024, at 8 AM.', 5, NULL, 0, 0, 0.000223914, 0.01),
(104, '2024-08-27', 'how can i join the wam 3b online meeting?', 'You can join the WAM 3B online meeting by clicking the provided link or by dialing 1 401-379-0785 and entering PIN 561 799 154.', 5, NULL, 0, 0, 0.000223914, 0.01),
(105, '2024-08-27', 'anong oras ang online meeting ng wam 3b?', 'Ang online meeting ng WAM 3B ay nakatakdang sa bukas, Setyembre 21, 2024, sa ganap na 8 AM.', 5, NULL, 0, 0, 0.000223914, 0.01),
(106, '2024-08-21', 'what time is the online orientation for bsit iva wam itep 414?', 'The online orientation for BSIT IVA WAM ITEP 414 is today, September 20, 2024, at 1:00 PM.', 5, NULL, 0, 0, 0.000223914, 0.01),
(107, '2024-08-21', 'anong oras ang online orientation para sa bsit iva smp itst 306?', 'Ang online orientation para sa BSIT IVA SMP ITST 306 ay ngayong araw, Setyembre 20, 2024, sa ganap na 8:15 AM.', 5, NULL, 0, 0, 0.000223914, 0.01),
