(872, '2024-11-06', 'Kailan ka ginawa?', 'Ako ay dinevelop at inilunsad noong 2024 upang makatulong sa mga estudyante at staff ng College of Computer Studies sa iba\'t ibang akademikong at administratibong gawain.', 3, NULL, 1, 0, 0.00005, 0.3),
(873, '2024-11-06', 'When were you invented?', 'I was developed and launched in 2024 to assist students and staff at the College of Computer Studies with various academic and administrative tasks.', 3, NULL, 1, 0, 0.00005, 0.3),
(874, '2024-11-06', 'Sino ang gumawa sa\'yo?', 'Ako ay nilikha ng isang team ng mga developer at researcher mula sa College of Computer Studies, kabilang sina Ms. Lesly-Ann B. Victoria, Mr. Jonathan Q. Laganzon, at Mr. Carlo R. Caburnay.', 3, NULL, 1, 0, 0.00005, 0.3),
(875, '2024-11-06', 'Who invented you?', 'I was created by a team of developers and researchers from the College of Computer Studies, which includes Ms. Lesly-Ann B. Victoria, Mr. Jonathan Q. Laganzon, and Mr. Carlo R. Caburnay.', 3, NULL, 1, 0, 0.00005, 0.3),
(876, '2024-11-06', 'Hanggang anong mga tanong ang kaya mong sagutin?', 'Kaya kong sagutin ang iba\'t ibang tanong na may kinalaman lamang sa College of Computer Studies.', 3, NULL, 1, 0, 0.00005, 0.3),
(877, '2024-11-06', 'Up to what kind of questions can you answer?', 'I can answer a wide range of questions related to the College of Computer Studies Only.', 3, NULL, 1, 0, 0.00005, 0.3),
(878, '2024-11-06', 'Ano ang office hours ng Dean\'s Office?', 'Ang Dean\'s Office ay bukas mula 7:00 AM hanggang 5:00 PM, Lunes hanggang Biyernes.', 3, NULL, 1, 0, 0.00005, 0.3),
(879, '2024-11-06', 'What are the office hours for the Dean\'s Office?', 'The Dean\'s Office is open from 7:00 AM to 5:00 PM, Monday to Friday.', 3, NULL, 1, 0, 0.00005, 0.3),
(880, '2024-11-06', 'Paano ako makakontak ang Dean\'s Office?', 'Maaari kang makipag-ugnayan sa Dean\'s Office sa pamamagitan ng email sa ccssantacruz2020@gmail.com.', 3, NULL, 1, 0, 0.00005, 0.3),
(881, '2024-11-06', 'How can I contact the Dean\'s Office?', 'You can contact the Dean\'s Office via email at ccssantacruz2020@gmail.com.', 3, NULL, 1, 0, 0.00005, 0.3),
(882, '2024-11-06', 'Saan matatagpuan ang Dean\'s Office?', 'Ang Dean\'s Office ay matatagpuan sa unang palapag ng CCS building.', 3, NULL, 1, 0, 0.00005, 0.3),
(883, '2024-11-06', 'Where is the Dean\'s Office located?', 'The Dean\'s Office is located on the first floor of the CCS building.', 3, NULL, 1, 0, 0.00005, 0.3),
