(1041, '2024-11-07', 'What is the off-campus tour for 4th year students?', 'The off-campus tour for 4th-year students includes a retreat and team-building at Forest Crest Nature Hotel and Resort, with access to the swimming pool, facilities, and function room.', 3, NULL, 1, 0, 0.00005, 0.3),
