(1044, '2024-11-07', 'What meals are included in the tour package?', 'The meal package includes:\n- Day 1: Breakfast (packed fast-food), Lunch (packed fast-food), Dinner (managed buffet)\n- Day 2: Breakfast (managed buffet), Lunch (managed buffet), Dinner (managed buffet)\n- Day 3: Breakfast (managed buffet), Lunch (packed fast-food), Dinner (own pax)', 3, NULL, 1, 0, 0.00005, 0.3),
(1045, '2024-11-07', 'Anong mga meals ang kasama sa tour?', 'Kasama ang mga sumusunod na pagkain sa tour:\n- Unang araw: Breakfast (packed fast-food), Lunch (packed fast-food), Dinner (managed buffet)\n- Ikalawang araw: Breakfast (managed buffet), Lunch (managed buffet), Dinner (managed buffet)\n- Ikatlong araw: Breakfast (managed buffet), Lunch (packed fast-food), Dinner (own pax)', 3, NULL, 1, 0, 0.00005, 0.3),
(1046, '2024-11-07', 'Is transportation included in the tour?', 'Yes, all-in transportation is included, covering fuel, toll fees, parking fees, drivers fee, and coordination services.', 3, NULL, 1, 0, 0.00005, 0.3),
(1047, '2024-11-07', 'Kasama ba ang transportation sa tour?', 'Oo, kasama sa package ang transportation, kasama na ang fuel, toll fees, parking fees, at drivers fee.', 3, NULL, 1, 0, 0.00005, 0.3),
(1048, '2024-11-07', 'What are the additional inclusions for the off-campus tour?', 'Additional inclusions are: Tour coordinator, trained tour guide (NC2, Kabalikat, Red Cross), lecture fees, entrance fees, and accident insurance for two days.', 3, NULL, 1, 0, 0.00005, 0.3),
(1049, '2024-11-07', 'Anong mga dagdag na inclusions para sa tour?', 'Kasama sa tour ang tour coordinator, trained tour guide (NC2, Kabalikat, Red Cross), lecture fees, entrance fees, at accident insurance para sa dalawang araw.', 3, NULL, 1, 0, 0.00005, 0.3),
(1050, '2024-11-07', 'How many faculty can join free per bus?', 'Two faculty members can join free of charge per bus, provided there are 47 full-paying participants per bus.', 3, NULL, 1, 0, 0.00005, 0.3),
(1051, '2024-11-07', 'Ilang faculty ang pwedeng sumama sa tour ng walang bayad?', 'Dalawang faculty members ang pwedeng sumama ng libre bawat bus kung may 47 full-paying participants per bus.', 3, NULL, 1, 0, 0.00005, 0.3),
(1052, '2024-11-07', 'Is accident insurance included in the tour?', 'Yes, accident insurance coverage and accident medical reimbursement are included for each tour participant for two days.', 3, NULL, 1, 0, 0.00005, 0.3),
(1053, '2024-11-07', 'Kasama ba ang accident insurance sa tour?', 'Oo, kasama ang accident insurance coverage at accident medical reimbursement para sa bawat tour participant sa loob ng dalawang araw.', 3, NULL, 1, 0, 0.00005, 0.3),
